def extract_images_from_pdf(base64_pdf):
    pdf_data = base64.b64decode(base64_pdf)
    pdf_file = BytesIO(pdf_data)

    pdf_reader = PyPDF2.PdfReader(pdf_file)

    images = []

    for page_number in range(len(pdf_reader.pages)):
        page = pdf_reader.pages[page_number]

        if "/XObject" in page["/Resources"]:
            x_objects = page["/Resources"]["/XObject"].get_object()

            for obj in x_objects:
                if x_objects[obj]["/Subtype"] == "/Image":
                    image = x_objects[obj]
                    if "/Filter" in image:
                        if image["/Filter"] == "/FlateDecode":
                            img_data = image._data

                            uri = convertTodataUri(img_data)

                            images.append(uri)

                        elif image["/Filter"] == "/DCTDecode":
                            img_data = image._data

                            uri = convertTodataUri(img_data)

                            images.append(uri)
                        elif image["/Filter"] == "/JPXDecode":
                            img_data = image._data

                            uri = convertTodataUri(img_data)

                            images.append(uri)
    return images


def upload_base64_image_to_s3(bucket_name, image_name, base64_data):
    # Decode the Base64 data
    image_data = base64.b64decode(base64_data)

    # Create a Boto3 S3 client
    s3_client = boto3.client("s3")

    try:
        # Upload the image data to S3
        response = s3_client.put_object(
            Bucket=bucket_name,
            Key=image_name,
            Body=image_data,
            ACL="public-read",
        )

        if response["ResponseMetadata"]["HTTPStatusCode"] == 200:
            print(
                f"Image '{image_name}' uploaded successfully to S3 bucket '{bucket_name}'."
            )
        else:
            print("Error uploading image to S3.")

            # Get the public URL of the uploaded image
        s3_url = f"https://{bucket_name}.s3.amazonaws.com/{image_name}"
        return s3_url
    except Exception as e:
        raise HTTPException(status_code=500, detail=str(e))


